import NavBar from "../../components/NavBar";
import Footer from "../../components/Footer";

const NotFound = () => {
  return (
    <div className="error">
      <NavBar />
      <div className="errorContainer">
        <p>Page not found!</p>
      </div>
      <Footer />
    </div>
  );
};

export default NotFound;
